import { ChangeEvent } from 'react';
import Backdrop from '@mui/material/Backdrop';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import Fade from '@mui/material/Fade';
import { modalStyle } from '../../Utils/style';
import { Button, TextField, Typography } from '@mui/material';

import './style.scss';

type Category = {
	english: string;
	arabic: string;
	icon?: string;
};

type TransitionsModalProps = {
	open: boolean
	newCategory: Category
	errors: { [key: string]: string }
	setErrors: React.Dispatch<React.SetStateAction<Category>>
	setNewCategory: React.Dispatch<React.SetStateAction<Category>>;
	closeModal: () => void;
};


const AddCategory: React.FC<TransitionsModalProps> = ({ open, closeModal, newCategory, setNewCategory, errors, setErrors }) => {

	const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
		const { name, value } = e.target;
		setNewCategory((prev) => ({ ...prev, [name]: value }));
		setErrors(prev => ({ ...prev, [name]: '' }))
	};

	const validateRequiredFields = () => {
		const newErrors = { english: '', arabic: '' };
		if (!newCategory.english) newErrors.english = 'Category Name (English) is required'
		if (!newCategory.arabic) newErrors.arabic = 'Category Name (arabic) is required'
		setErrors(newErrors)
		return !newErrors.english && !newErrors.arabic
	}

	const handleCancel = () => {
		setNewCategory({ english: '', arabic: '' })
		setErrors({ english: '', arabic: '' })
		closeModal();
	}

	const handleSubmit = () => {
		if (validateRequiredFields()) {
			console.log(newCategory)
			closeModal();
		}
	};

	const icons = [
		{
			name: 'Rice',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Sea Food',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Soup',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Coffee',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Pizza',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Burger',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Rice',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Sea Food',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Soup',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Coffee',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Pizza',
			src: 'data:image/png;base64,',
		},
		{
			name: 'Burger',
			src: 'data:image/png;base64,',
		},
	]

	return (
		<Modal
			aria-labelledby="transition-modal-title"
			aria-describedby="transition-modal-description"
			open={open}
			onClose={closeModal}
			closeAfterTransition
			slots={{ backdrop: Backdrop }}
			slotProps={{ backdrop: { timeout: 500 } }}
		>
			<Fade in={open}>
				<Box className="madal" sx={modalStyle}>
					<Box className="modal-head">
						<Typography id="modal-modal-title" variant="h6" component="h2">
							New Category
						</Typography>
					</Box>
					<Box className="modal-body">
						<Box className="inputs-container">
							<TextField
								name='english'
								className='input'
								label="Category Name (English)"
								variant="outlined"
								value={newCategory.english}
								onChange={handleChange}
								required
								error={!!errors.english}
								helperText={errors.english}
							/>

							<TextField
								name='arabic'
								className='input'
								label="إسم القسم (بالعربية)"
								variant="outlined"
								value={newCategory.arabic}
								onChange={handleChange}
								dir='rtl'
								required
								error={!!errors.arabic}
								helperText={errors.arabic}
							/>
						</Box>
						<Box className="icons-section">
							<Typography className='label' variant='body2'>Choose Icon</Typography>
							<Box className="icons-container">
								{icons.map((icon, index) => (
									<Box className="icons" key={index}>
										<img
											key={index}
											className={`icon ${newCategory.icon === icon.name ? 'active' : ''}`}
											src={icon.src}
											alt={icon.name}
											onClick={() => setNewCategory((prev: any) => ({ ...prev, icon: icon.name }))}
										/>
										<Typography variant='caption' color='GrayText' className="title">{icon.name}</Typography>
									</Box>
								))}
							</Box>
						</Box>
					</Box>

					<Box className="modal-footer">
						<Button className='white' variant="contained" size='large' onClick={handleCancel}>
							Cancel
						</Button>
						<Button variant="contained" size='large' color="primary" onClick={handleSubmit}>
							Add Category
						</Button>
					</Box>
				</Box>
			</Fade>
		</Modal>
	);
}

export default AddCategory